INSERT INTO sakila_snowflake.fact_rental 
(rental_id, rental_last_update, 
customer_key, staff_key, film_key, store_key, 
rental_date_key, 
return_date_key,
count_rentals, 
count_returns, 
rental_duration, 
dollar_amount)
	( SELECT 
    r.rental_id, r.last_update,
	c.customer_key, dstaff.staff_key, f.film_key, dstore.store_key,
	drental.date_key AS rental_date_key, 
    dreturn.date_key AS return_date_key,
	count(r.rental_id) AS count_rentals, 
    count(r.return_date) AS count_returns,
	f.film_rental_duration AS rental_duration, 
    p.amount AS dollar_amount
	FROM sakila.rental AS r
    JOIN sakila.payment AS p 
		ON r.rental_id = p.rental_id
	JOIN sakila_snowflake.dim_customer AS c 
		ON r.customer_id = c.customer_id
	JOIN sakila_snowflake.dim_staff AS dstaff 
		ON r.staff_id = dstaff.staff_id
	JOIN sakila.inventory AS i ON r.inventory_id = i.inventory_id
	JOIN sakila_snowflake.dim_film AS f
		ON i.film_id = f.film_id
	JOIN sakila_snowflake.dim_store AS dstore
		ON i.store_id = dstore.store_id
	JOIN sakila_snowflake.dim_date as drental
		ON DATE(r.rental_date) = drental.date
	LEFT JOIN sakila_snowflake.dim_date as dreturn
		ON DATE(r.return_date) = dreturn.date
	GROUP BY r.rental_id, 
    r.last_update,
	c.customer_key, 
    dstaff.staff_key, 
    f.film_key, 
    dstore.store_key,
    drental.date_key, 
    dreturn.date_key );
